INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (8, 27, 1, 86, 'When Larry and I were little, grandma had a tradition of inviting us individually for a special overnight visit where we got to decide what to play/eat/do the whole time.  I remember one visit where we first went to the store to pick out a cereal for the morning (anything I wanted- chose Lucky Charms), had some ice cream at the newton corner Baskin Robbins, listened to old music and played with a new Barbie in the kitchen sink all night  :)', 'Diane', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (9, 62, 1, 86, 'Grandma was much more tough + fearless than the rest of us.  I remember one time when I was 9 or so, dad was away I think and we had a mouse in the basement that was freaking out me and mom.  Grandma came over to the rescue after the traps had a catch- but instead of just disposing of the mice + traps at once, she EMPTIED the traps by hand so we could reuse them', 'Diane', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (10, 62, 1, 86, 'I always remember grandma shopping and gardening- if she found a good deal on something she\'d stock up (an understatement), and would swing by the house with some for us too.  She\'d also come around gardening sometimes, and at one point she had a gardening plot where I think she grew vegetables.  She would also go berry picking in the summer locally and sometimes she took us too :)', 'Diane', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (11, 61, 1, 72, 'Mom and Catherine were really close when they were younger. Catherine worked at\r\nBell laboratories and got mom a job there one summer. They lived together for a\r\nwhile when their husbands were in WWII. She really enjoyed their phone calls\r\nover the past year and she took Aunt Catherine\'s passing to heart.', 'Anita', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (12, 62, 1, 72, 'Mom and Catherine were really close when they were younger. Catherine worked at\r\nBell laboratories and got mom a job there one summer. They lived together for a\r\nwhile when their husbands were in WWII. She really enjoyed their phone calls\r\nover the past year and she took Aunt Catherine\'s passing to heart.', 'Anita', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (13, 146, 1, 72, 'I had Izzy for health class in high\r\nschool. When she came over to the house she\'d have a beer with dad and made me\r\nswear never to tell anyone at school that she drank. She was this tiny little\r\nold lady and was the most of the most respected and feared teachers.', 'Anita', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (14, 237, 1, NULL, '[Nicholas Keem] said his father Martin Keem Sr. while blasting in the Erie Canal had the misfortune of fracturing a leg, whereupon he came to Sheldon for asylum and care.  This would indicate kinfolk.  Furthermore, the incident happened before 1826, when the canal was in operation.', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (15, 62, 1, 72, 'I always thought Uncle Bob and Aunt Catherine were such a good looking couple.  They were both a lot of fun and livened things up when we were all together.', 'Anita', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (16, 75, 1, 72, 'I always thought Uncle Bob and Aunt Catherine were such a good looking couple.  They were both a lot of fun and livened things up when we were all together.', 'Anita', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (17, 23, 1, NULL, 'The family moved up to Burlington when Stanley was in high school.  Bessie & Louis moved back down to MA when Norman was a senior in med school, so Norman and Stanley lived together for a couple years, renting rooms with a professor.  One year Stanley had the lead in the high school play, and Norman practiced with him, training him on expressions.', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (18, 15, 1, 24, 'She would make a penny go a mile.  [paraphrased: She was very clean, and swept the steps and the sidewalk.  She was strong in the household.]', 'Norman', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (19, 24, 1, NULL, 'In high school, Norman was the president of the \"Quarter Club\"- they had 25 members and it cost 25 cents to come and play pool.  When Norman moved up to Burlington, he was given the pool table, and they kept it in the attic.', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (20, 25, 2, NULL, 'In Burlington, Norman worked in Matthew\'s/Louis\' shoe store on Friday afternoons.  Annette was the cashier at the store.  Every Friday night they\'d go dancing at a local roller rink that would bring in an outside band.  On Sunday they\'d go horseback riding.  Also Norman got a \"fold boat\" and he bought a lanteen sail and a keel for it- they\'d go out together on Lake Champlain.', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (21, 24, 1, NULL, 'Norman was a medical officer for a platoon.  The family lived together in Texas for 2 years.  Beth was born during this time, and they rented a home rather than living in barracks.  Norman was scheduled to go over to Japan, but the war ended before it was time.', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (22, 30, 1, 24, 'Larry was very kind- he was good to the whole family.', 'Norman', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (23, 30, 1, NULL, '<a href= \"persondetail.asp?personID=5\">Jack</a> and Larry were in the same fraternity together.', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (24, 5, 1, NULL, '\r\nJack and <a href= \"persondetail.asp?personID=30\">Larry</a> were in the same fraternity together.', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (25, 174, 1, 24, 'Leonard was very social, and worked at a bakery.  He made our wedding cake.', 'Norman', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (26, 17, 1, NULL, 'According to Norman, Solomon was short and Ida was tall', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (27, 16, 1, NULL, 'According to Norman, Solomon was short and Ida was tall', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (28, 4, 2, NULL, 'Norman went to stay with Solomon & Ida for a little while when Bessie was pregnant with Stanley', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (29, 19, 1, NULL, 'According to Norman, Charlie was handsome and married someone wealthy.', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (30, 15, 1, 86, 'Bubbie had long long hair that she\'d wear up in a bun.  Whenever we\'d go to visit, she\'d have a dish of peanuts and raisins on the table.  We\'d all sit and talk, and I remember her as warm and digified.  The combination of peanuts and raisins still makes me think of those visits.', 'Diane', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (31, 29, 1, 31, 'When Kalman Kobrin landed in New York, USA, he couldn\'t speak English.  The immigration officials somehow tagged Kalman with the surname of Kaplan.  Consequently, subsequent generations carry the surnname Kaplan instead of Kobrin.  The surname was maintained even upon Kalman becoming a United States citizen', 'Joe Kaplan', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (32, 92, 1, 31, 'My son Kalman Kobrin had the surname legall changed back to Kobrin on October 25, 1957, at the Probate Court in the County of Middlesex, in the Commonwealth of Massachusetts (document No. 345411)', 'Joe Kaplan', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (33, 90, 2, NULL, 'The Kobrin\'s family trade in Russia was harness-making.  Kalman had 2 brothers and 1 sister who left Russia and settled in South Africa during the same time that he left for the USA.  At the time of his brothers\' arrival in South Africa, the Great Boar War had broken out.  Because of this, the Kobrin brothers received some large contracts with the South African Army to make riding breeches for their calvary forces.  Due to these large contracts they became very wealthy and acquired a very large estate which was later passed on to their children in South Africa.', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (34, 32, 1, NULL, 'Medical info: she was only around 5\' tall- juvenile diabetic on insulin.  overweight in later years.', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (35, 379, 1, NULL, 'Mary wrote this note in <a href=\"persondetail.asp?personid=62\">Kay\'s</a> childhood autograph book on April 30, 1931: <br/><br/>\r\n\r\nDear Catherine,  <br/>\r\nOnce I went into a garden to pick a mess of peas <br/>\r\nAnd I nearly died laughing to see a chicken sneeze <br/> \r\nYour cousin <br/>\r\nMary Suttell', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (36, 374, 1, NULL, 'Edna wrote this note in <a href=\"persondetail.asp?personid=62\">Kay\'s</a> childhood autograph book on August 30, 1931 (on a page that\'s now greenish blue): <br/><br/>\r\n\r\nDear Catherine,  <br/>\r\nNever feel as the color of this page <br/>\r\nWith Love <br/>\r\nEdna', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (37, 60, 1, NULL, 'Doris wrote this note in <a href=\"persondetail.asp?personid=62\">Kay\'s</a> childhood autograph book on April 10,1932: <br/><br/>\r\n\r\nDear Sister, <br/>\r\nLoyal friendship pure and true.  Such as that I feel for you. <br/>\r\nYour Sister, <br/>\r\nDoris M Keem', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (38, 61, 1, NULL, 'Viola wrote this note in <a href=\"persondetail.asp?personid=62\">Kay\'s</a> childhood autograph book on November 1, 1933: <br/><br/>\r\n\r\nDear Sister, <br/>\r\nThe night was dark and dreary, <br/>\r\nthe billy goat was blind<br/>\r\nHe backed into a barbed wire fence<br/>\r\nand scratched his \'nevermind\'<br/>\r\nYour Sister, <br/>\r\nViola Keem', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (39, 73, 1, 181, 'She was a lovely lady', 'Tess', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (40, 169, 1, 420, 'Sam Nitkin learned the leather trade in Russia, and emigrated to the US. With the automobile becoming dominant and the horse industry fading, he turned to building trades. He was a painter for commercial properties. \r\nHe lived in the South End of Boston until 1935, at which time he moved with his family to the Dorchester/Mattapan section of Boston. Sam Nitkin was active in organized labor, and was a president of the labor union local that represented painters in Boston. He never owned a house, but his apartment in his later years - in the Georgtown development in Hyde Park - was a regular gathering place for his family. His children and grandchildren would gather on weekends, either for French toast in the morning or Kentucky Fried Chicken at night. He loved to talk politics with his family and play the card game pinochle. He taught his grandchildren how to play poker, and gave them little gifts like flashlights. He made a point of buying a tallis and tfilon for each of his grandsons when they were Bar Mitzvahed.', 'David Nitkin', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (41, 14, 1, 420, 'She was a quiet woman, but strong.', 'David Nitkin', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (42, 318, 1, 96, '\tMarried to Richard Swartz 8-27-1996, lives in North Andover, MA.  Has 2 step sons Jonathan & Daniel Swartz\t          \t\t \t ', 'Rosealyn Nolan', '2010-02-04 13:29:34', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (43, 96, 1, 96, '\t\t Married David Clark Nolan 11-29-2008.         \t\t \t ', 'Rosealyn Nolan', '2010-02-04 13:37:55', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (45, 75, 1, 81, '\t\t          Born in Buffalo\r\nincredible athlete--minor league baseball, golf\r\nLocal involvement: planning board, volunteer fire departement\t\t \t ', 'Susan Kaplan', '2010-03-11 11:19:33', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (47, 146, 1, 81, '\t\t          Izzy was very close to Kay. The two of them were disapproved of by their mother in law (Sarah) and established a loving bond together. Izzy loved Debbie, Robby and Susan alot and treated them like the children she couldn\'t have. \t\t \t ', 'Susan Kaplan', '2010-03-11 11:24:26', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (48, 43, 1, 81, 'She was a tiny woman and an incredibly hard worker. She lived with Leona for many years in a home with a coal stove and in those times, no electricity in the upstairs. When we would stay there, we took candles upstairs to go to bed--very exciting for us as kids. \t\t          \t\t \t ', 'Susan Kaplan', '2010-03-11 11:29:09', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (49, 73, 1, 81, 'She was always well dressed and quite stylish. She doted on her grandchildren and her sons. \t\t          \t\t \t ', 'Susan Kaplan', '2010-03-11 11:31:53', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (50, 58, 1, 81, 'It was said that Leona was born at home and did not receive enough oxygen at birth. She was devoted to her mother and lived with her for many years, caring for the house and her mother\'s needs. She loved the visits from us kids and was interested in anything we were doing. She had a Christmas cookie collection from year to year,  saving the best cookie from the previous year--she really did it to amuse us. \t\t          \t\t \t ', 'Susan Kaplan', '2010-03-11 11:36:25', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (51, 66, 1, 81, 'Patty, Maria, Cathy and I were all cousins of the same age, all had fun when we were together. Patty was warm, generous and giving in every way. I wish that we could find a way to contact her.\t\t          \t\t \t ', 'Susan Kaplan', '2010-03-11 11:38:19', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (52, 59, 1, 81, 'Kay was always grateful to Helen and felt that she was incredibly generous with her as the kid sister in terms of school and life in general. Helen was extremely religious. When we would stay there, each night we would say the rosary, kneeling on the floor in the living room. \t\t          \t\t \t ', 'Susan Kaplan', '2010-03-11 11:42:48', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (53, 61, 1, 81, 'Kay adored Viola and had a wonderful relationship with her. She felt that Viola was sweet as a sister and valued their relationship in later life as well. \t\t          \t\t \t ', 'Susan Kaplan', '2010-03-11 11:47:05', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (54, 43, 1, 79, 'We visited Grandma once a year - a long drive from Albany - I only remember her from about age 86 and up.  She was teenee-tiny and she and Leona were \"green\" way before their time.  They saved and reused things that other people didn\'t in those times, but now we would be so proud of their recycling ways.  Their house was so homey and I always wished to play the piano.  I often did play the pump organ in the garage (no one could hear my beginner attempts at playing).  My favorite memory was the maple cookies (pure maple sugar hardened into a cookie) they would dole out when we came.          \t\t \t ', 'Deborah Bartlett', '2010-03-14 15:44:45', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (55, 60, 1, 79, 'I remember staying with Aunt Doris & Uncle Jerome when we would come to visit.  The farm house always had fresh milk from the cows with cream floating on top.  Once when we were there I helped Aunt Doris can fruits and jams for the winter and my most vibrant memory was my mom & dad playing Pinochle and Euchre til all hours of the morning.\t\t          \t\t \t ', 'Deborah Bartlett', '2010-03-14 15:55:09', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (56, 63, 1, 79, 'I remember Uncle Jerome as a quiet kind of hard working man - always seemed very kind to us as kids.\t\t          \t\t \t ', 'Deborah Bartlett', '2010-03-14 15:56:05', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (57, 59, 1, 79, 'I remember Mom (Kay) talking about how Helen was her grade school teacher when she was growing up and how hard that was.  \"Imagine coming home and my teacher would be right there telling me I didn\'t study for a test enough\"!  Mom felt she couldn\'t get away with any slacking - in her heart I know she felt it was great that Helen was always there to push her to do her best.  \t\t          \t\t \t ', 'Deborah Bartlett', '2010-03-14 15:59:34', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (58, 61, 1, 79, 'I remember mom telling me that she and Aunt Viola lived away from home one summer and were nannies for some family in Buffalo.  It allowed them to go to school in the city and they earned their way by taking care of this family\'s kids and house.  Their father certainly taught all of his daughters how to earn their own way.  It is still something I admire of this whole family of women.\t\t          \t\t \t ', 'Deborah Bartlett', '2010-03-14 16:02:05', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (59, 81, 1, 79, 'This is my fabulous sister whom I love & admire so much.  I adored her as a child and still do as an adult.  I love you Susie!\t\t          \t\t \t ', 'Deborah Bartlett', '2010-03-14 16:06:52', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (60, 80, 1, 79, 'This is my brother who means so much to me.  He took care of me many times when I was a kid, always stumbling or hurting myself.  He now has a wonderful family who I adore and know he is happy in his life.\t          \t\t \t ', 'Deborah Bartlett', '2010-03-14 16:10:30', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (61, 85, 1, 79, 'I have so many memories of Larry, as a baby, boy and now as an adult.  Larry is the kindest person I know, always there with a laugh and love for those around him.\t\t          \t\t \t ', 'Deborah Bartlett', '2010-03-14 16:11:58', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (62, 86, 1, 79, 'Diane is my favorite (and only) girl in our family.  We are blessed to have her in our family.  She brings a strong woman\'s point of view to our lives. She is adventurous and loves life.\t\t          \t\t \t ', 'Deborah Bartlett', '2010-03-14 16:13:56', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (63, 602, 1, 597, 'Son Dennis lives in Florida .. Pensacola\t\t          \t\t \t ', 'Myrna Pochel', '2010-03-14 23:16:08', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (64, 591, 1, 597, '\tSon Ray deceased owns business 3 blocks from me-Pochels Appliances\t          \t\t \t ', 'Myrna Pochel', '2010-03-14 23:17:49', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (1, 48, 2, 82, 'We lived in Hyde Park, an urban neighborhood of Boston.  Our main family vacations were camping in Maine.  My brother John was an alter boy.  My sister Kathy bowled candlepin.  I played hockey on the field down the street.  My frather owned and operated a service station, where John and I worked when we reached 16.  Both JOhn and Kathy went to Hyde Park HS, and I went to Catholic Memorial HS because of the unrest in Boston Schools due to forced bussing.  My mother Barbara stayed at home and raised the kids and did the banking for my father\'s business.', 'Paul', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (3, 79, 1, NULL, '<p>My primary interest is of course, my family.  Paul + I are very involved with our kids, Dan + Joe. When they were little I got involved in their elementary school- JFK Memorial.  I became the PCC Chairman + was in office for 3 years.  I was then on the School Improvement Council and finally ran for public office in 2003 and was elected to the Franklin Town Council.  This work keeps me very busy. </p>\r\n<p>The rest of my waking moments are spent going to the kids\' activities- hockey, soccer, bands + jazz bands.  I live a very full life with Paul and I don\'t think we will ever say we wasted time in our lives or we\'re bored!</p>', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (4, 79, 1, 86, 'At Christmas time, Debbie is the cookie <b>master</b>!  She has containers and containers of every imaginable kind- old favorites and always some new recipes too', 'Diane', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (5, 82, 1, NULL, '<p>Most of my time is spent coaching the kids\' sports teams, both hockey and soccer.  I started as an assistant coach when Danny started playing travel hockey in 1998.  Now I\'m mostly involved with Joey\'s soccer teams.  Ouside of the kids\' sports I\'m involved with town volunteer stuff.  I spent two years on the school district\'s NetDay Committee wiring all the schools for Internet access.  In 1999 I ran for Town Council and lost by 33 votes.  I served for 6 years on the town\'s Finanace Committee.  With all our volunteer work Deb and I have very little down time, but we find it very rewarding.</p>', NULL, NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (6, 16, 2, 79, 'We live in Franklin, MA.  We enjoy our home where we live with Pikachu, our Golden Retriever.  We enjoy the kids\' sports and music.  Our family traditions are: \r\n<ul><li>Saratoga NY Jazz Festival with Ben, Denise, Janet, + Al.  </li>\r\n<li>Summer vacation at Barton\'s Motel, Lake Winnepesaukee. </li>\r\n<li>Apple picking at Tougas Farm in Northborough, MA. </li>\r\n<li>Christmas Eve at Susie\'s, and Christmas morning with crepes (supplied by Larry + Diane) and strawberries + blueberries and fresh whipped cream here at our house. </li>\r\n</ul>', 'Debbie', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (7, 15, 2, 79, '<p>We grew up in Voorheesville, NY.  I remember always having pets, both cats and dogs.  I also remember Dad hunting with them + bringing home his catch.  Mom and I would prep the bird for cooking and discuss basic biology. </p>\r\n<p>I remember Mom always keeping the house neat + clean and being a good cook.  She was very strong with me as her daughter, telling me that I needed an education + needed to be able to support myself. I spent a lot of time with her in the kitchen listening to her stories or cooking information, sitting at the little kitchen table.  </p>\r\n<p>One of the traditions was the Punkin Town Fair- benefitted the volunteer New Salem Fire Department.  Dad was the chairman for a few years and mom did cotton candy and I had free reign of the place.  Voorheesville was a fun place to grow up- safe, but sometimes boring. </p>', 'Debbie', NULL, 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (65, 591, 1, 597, 'Also a daughter who works for NASA and you will find her all over the internet.  I think the name is Carol.\t\t          \t\t \t ', 'Myrna Pochel', '2010-03-14 23:19:18', 1);
