INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (74, 79, 1, 81, 'Debs--you are the best sister anyone could have...I love you more than you know. You are an incredible mother a warm, funny, unbelievably generous person. \t\t          \t\t \t ', 'Susan Kaplan', '2010-03-19 13:37:42', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (75, 84, 1, 81, 'Joey as a little boy was so passionate about every thing that interested him--he was (and is!) a joy and treasure to all of us.\t\t          \t\t \t ', 'Susan Kaplan', '2010-03-19 13:48:15', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (76, 83, 1, 81, 'Dan has always been a wonderful part of our family as well as Deb and Pauls from the night of his birth on. He is a strong, independent young man really beginning a new part of his life at Northeastern. ', 'Susan Kaplan', '2010-03-19 13:52:23', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (79, 125, 1, 125, '\tDad, Mom, Alicia and I celebrating Cousin Kenny\'s 70th birthday with extended family.  Cousins, uncles, etc.  GREAT weekend in Mass.\t          \t\t \t ', 'Debbie Feinberg', '2010-03-25 23:43:49', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (80, 25, 1, 125, '\tMatthew loved children and loved Ann, his wife dearly.  He ate bran cereal for breakfast, a tuna sandwich and fruit for lunch and fish, salad and rice for dinner.  He ate basically the same food daily at approximately the same time.      \t\t \t ', 'Deborah Kallman', '2010-03-26 00:20:32', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (82, 113, 1, 125, '\tAnn\'s home was spotless. She always welcomed us with a warm smile, bagels, cream cheese and fresh orange juice. Beds always had fresh, ironed linens and everything smelled like clean spring air.\t          \t\t \t ', 'Deborah Kallman', '2010-03-27 18:45:50', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (83, 198, 1, 81, 'My father would take me to visit Aunt Al and Aunt Joe. Aunt Al was, at that time, in her 90\'s and was rather stern and serious.\t\t          \t\t \t ', 'Susan Kaplan', '2010-03-30 10:55:58', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (84, 197, 1, 81, 'My father would take me to visit Aunt Al and Aunt Jo whenever we were in Buffalo. Aunt Jo was the livlier of the two and would have special treats for me and joked around about family members.\t\t          \t\t \t ', 'Susan Kaplan', '2010-03-31 10:07:15', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (85, 43, 1, 80, '\tIt was always an adventure going to grandma\'s house.  The earliest memories I have is of her old farmhouse (the house she had before the state decided to claim it for a road I think).  Anyhow there wasw a big living room/parlor with a big pot-bellied coal stove at one end  and us little kids would be on stools  at the opposite end..the end  the heat never reached.  Anyhow the water came from collected rainwater and the greatest adventure of all..grandma had an outhouse.  Imagine my poor father\'s face when I shook him awake at 3:00am to take me to the outhouse in the dead of winter..hey that\'s what dad\'s are for. Grandma was indeed a tiny little  woman..but a farm girl through and through.  I remember one time  she was getting ready to make chicken dinner for all of us..only the chicken was coming from a  small coop she had.  She sliced the head  off neatly and then proceeded to laugh with us children as the headless chicken ran in circles for a good couple  of minutes.\t          \t\t \t ', 'Robert Husband', '2010-04-14 16:17:17', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (86, 43, 1, 80, '\tWhenever we came to visit grandma she always had some  old newspaper clipping that she thought would interest you (in my case because I was tall for my age she\'d drag out a story about a 9 foot tall african guy..another time it was about a prehistoric fish fossil).  The tough part about visting grandma was always  saying the  rosary just before bedtime..utter torture for a little  kid as it just went on and on.  Whenever it was getting time  to go Grandma would  disappear for a bit then come back and make you feel real guilty..\"oh dear, I\'m feeling really old  today, I\'ll make it through spring, but that will  be  it you  won\'t see me again.\"  Then everyone  would  gather round  and make a big fuss and  we\'d have to stay for another couple  of hours until we\'d be getting ready to go and the act would begin all over  again.  She and  Aunt Leona used to make these sugar cookies for us..trouble is  they\'s bake them around Christmas and hold  on to them until we  arrived some  time in  August...hard as hockey pucks but whatever  she had in them ... no mold ever got on those cookies.\t          \t\t \t ', 'Robert Husband', '2010-04-14 16:25:58', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (87, 76, 1, 80, 'Memories of Uncle Rich\r\n\r\nWe didn’t get to see Uncle Rich a whole lot.  He would be on a road trip (I believe he used to work for Dell comic books when we were all little) in the general area and drop in for a day or two with a boat load of ‘little lulu’, ‘Ritchie Rich’  or ‘Archie and Jughead’ comics  He wasn’t a particularly tall man but always trim and in good shape.  He loved to laugh and tease us little kids in a good natured way.  He always called me ‘tiger’ and would immediately go to grab me by the hair on entering the house, but as I always had a brush cut in those days he would only grab air.  Then he’d grab my head in a headlock and punish my lack of hair by giving me semi-painful nuggies until I yelled ‘uncle….RICH’.  Seemed to be a happy-go-lucky kind of guy, quick with a joke and laughed a lot.\r\n\r\nI remember Mom telling me that Rich was a boxer both in the army and after the war as a semi-pro in and around Buffalo.  Very quick hands, stiff jab and a real dancer in the ring.  Problem was that although he didn’t take a lot of punishment when he did get hit flush on the jaw…down he would go like a sack of potatoes…glass jaw.  His career as a boxer, was therefore short-lived.\r\n\t\t          \t\t \t ', 'Robert Husband', '2010-04-30 16:41:30', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (88, 91, 1, 188, 'she loved to cook and when she did it was for an army. I do not recall her ever cooking for less than that. ', 'Barry Kloper', '2010-06-19 11:54:55', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (89, 92, 1, 188, 'Uncle Kal was like a surrogate father to us (my brother, sister, and me) after our father had died.\t ', 'Barry Kloper', '2010-06-19 11:55:13', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (90, 87, 1, 89, 'Kal was a WWII veteran who received a hero\'s welcome home, along with the distinguished flying cross.<br/>\r\nHis love for tennis allowed him to keep playing until the age of 80! He played a strong mental as well as physical game. On the court he was the \'drop shot\' king! <br/>Everyone knew him for his patience and kindness. ', 'Andrea O\'Brien', '2010-06-25 14:29:10', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (92, 80, 1, 81, 'Rob is the most wonderful father and not a bad brother either! He gave the absolute most accurate and humerous and moving story of our mother\'s life at her funeral...I will never forget it.\t\t          \t\t \t ', 'Susan Kaplan', '2010-06-29 13:23:28', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (93, 82, 1, 81, '\t\t          Paul is a wonderful member of our family--a great Dad and husband and alot of fun to be with and talk to. \t\t \t ', 'Susan Kaplan', '2010-06-29 13:26:09', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (94, 43, 1, 86, 'From Mary Ann Metzger: I knew Adell, she was so upset when they took her house down for the new road. Think she just sat in it. My Grandpa Schiltz sold her a lot in town and they built a small home, still kept very nice by new owners. ', 'Diane Kaplan', '2010-10-25 17:33:03', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (95, 17, 1, 114, 'We  lived in Brookline  and my parents would occasionally invite him for dinner. He was a sweet man. I also remember that he always brought something, probably candy. My Mother was touched by that, given his age and fraility.', 'Eleanor Feinberg', '2010-11-20 16:30:17', 1);
INSERT INTO `Notes` (`noteID`, `refID`, `Type`, `fromPerson`, `body`, `fromName`, `date`, `ActiveBool`) VALUES (96, 17, 1, 36, '<a href=\"/family/person.asp?personID=15\">Bu\t\tbbie</a> called him Schveh (yiddish for father in law), he would come over sometimes for dinner.  He was a quiet man, nice enough- he\'d sit quietly in a chair and read his paper (The Jewish Advocate).  It was a different time then.  Once when I was 4 or 5 years old I was playing with a boot, walking it around the floor. I walked it around and over him, and he gave a look of surprise: not unfriendly or particularly angry, but a look that I should know I shouldn\'t be doing that. There was a degree of formality that we don\'t have today, and children were to be seen and not heard.', 'Ken Kaplan', '2010-11-20 16:38:10', 1);
