INSERT INTO `people` (`personID`, `first`, `middle`, `last`, `maiden`, `nickname`, `face`, `siblingSeq`, `KeemBool`, `HusbandBool`, `KemlerBool`, `KaplanBool`, `interests`, `education`, `work`, `notes1`, `notes2`, `notes3`, `birthdate`, `birthplace`, `deathdate`, `Gender`, `origin`, `firstFamily`, `currentLocation`, `adoptedBool`, `directBool`, `hideBool`, `lastModified`, `flag1`, `flag2`) VALUES (237, 'Martin J', '', 'Keem', '', '', '', 0, 1, 0, 0, 0, '\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t ', '\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t ', 'Farmer, and he worked on the Erie Canal as a foreman and he employed 13 hired men.\r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t ', 'Came to America from Alsace Lorraine in 1834. After working on the erie canal where he sustained a fractured leg he came to willink (East Aurora) and was employed by the Elder Hamlin, Father of C.J. Hamlin and came to Sheldon in 1836 and was employed as \t', 'foreman by Dr. Ziba Hamillton for a period of 4 years to manage his large holdings. He then went to farming for himself and soon bought a farm in wales, Erie County, NY which became known as the \"Keem homestead\". \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t ', 'The 1850 census has them as the Keim family.  Burial: St. Cecilia RC Cem., Sheldon, NY\r\n\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t \r\n\t\t          \t\t \t ', '1/16/1811', 'Gunstett, Alsace', '1900', 'M', 'French', 132, '', 0, 1, 0, '2012-01-26 21:46:18', '', '');
INSERT INTO `people` (`personID`, `first`, `middle`, `last`, `maiden`, `nickname`, `face`, `siblingSeq`, `KeemBool`, `HusbandBool`, `KemlerBool`, `KaplanBool`, `interests`, `education`, `work`, `notes1`, `notes2`, `notes3`, `birthdate`, `birthplace`, `deathdate`, `Gender`, `origin`, `firstFamily`, `currentLocation`, `adoptedBool`, `directBool`, `hideBool`, `lastModified`, `flag1`, `flag2`) VALUES (238, 'Catherine', NULL, 'Keem', 'Kornprobst', NULL, NULL, 2, 1, 0, 0, 0, NULL, NULL, NULL, 'Came to America from Alsace with her husband', NULL, NULL, '4/11/1817', 'Schaenenburg, Alsace', '2/13/1894', 'F', 'French/German (not sure which they spoke)', 143, NULL, 0, 1, 0, NULL, NULL, NULL);
INSERT INTO `people` (`personID`, `first`, `middle`, `last`, `maiden`, `nickname`, `face`, `siblingSeq`, `KeemBool`, `HusbandBool`, `KemlerBool`, `KaplanBool`, `interests`, `education`, `work`, `notes1`, `notes2`, `notes3`, `birthdate`, `birthplace`, `deathdate`, `Gender`, `origin`, `firstFamily`, `currentLocation`, `adoptedBool`, `directBool`, `hideBool`, `lastModified`, `flag1`, `flag2`) VALUES (239, 'Martin', '', 'Keem', '', '', '', 1, 1, 0, 0, 0, '\t\t          \t\t \t \r\n\t\t          \t\t \t ', '\t\t          \t\t \t \r\n\t\t          \t\t \t ', '\t\t          \t\t \t \r\n\t\t          \t\t \t ', 'died at age 88\r\n\t\t          \t\t \t \r\n\t\t          \t\t \t ', 'Matching trees on ancestry.com have death date as Feb 1924     \t\t \t \r\n\t\t          \t\t \t ', '\t\t          \t\t \t ', '12/1835', '', '1922', 'M', 'French or German descent (Alsace)', 76, '', 0, 0, 0, '2011-02-21 12:32:47', '', '');
INSERT INTO `people` (`personID`, `first`, `middle`, `last`, `maiden`, `nickname`, `face`, `siblingSeq`, `KeemBool`, `HusbandBool`, `KemlerBool`, `KaplanBool`, `interests`, `education`, `work`, `notes1`, `notes2`, `notes3`, `birthdate`, `birthplace`, `deathdate`, `Gender`, `origin`, `firstFamily`, `currentLocation`, `adoptedBool`, `directBool`, `hideBool`, `lastModified`, `flag1`, `flag2`) VALUES (240, 'John', '', 'Keem', '', '', '', 4, 1, 0, 0, 0, '\t\t          \t\t \t ', '\t\t          \t\t \t ', 'After working on the Erie Canal, John moved to Willink (now Aurora) and then Sheldon in 1836.  Afterward he went into farming for himself and bought a farm in Wales which became known as the Keem homestead\r\n\t\t          \t\t \t ', 'died at age 84, and lived in Wales, NY\r\n\t\t          \t\t \t ', '\t\t          \t\t \t ', '\t\t          \t\t \t ', '1844', '', '', 'M', 'French or German descent (Alsace)', 76, '', 0, 0, 0, '2011-03-13 12:13:00', '', '');
